const mongoose = require("mongoose"); 
const Schema = mongoose.Schema; 
 
let citaSchema = new Schema( 
  { 
    nombre: { 
      type: String, 
    }, 
    correo: { 
      type: String, 
    }, 
    telefono: { 
      type: Number, 
    },
    hora: { 
      type: String, 
    }, 

    fecha:  
      {type: Date}, 
    
  }, 
  { 
    collection: "citas", 
  } 
); 
 
module.exports = mongoose.model("Cita", citaSchema);
